import * as React from 'react';
import instalogo from "./assets/instagram-logo.png"
import { Link } from "react-router-dom";
import Divider from '@mui/material/Divider';
import ListItemButton from '@mui/material/ListItemButton';
import { Button } from '@mui/material';

import Home from '@mui/icons-material/Home';
import Search from '@mui/icons-material/Search';
import Explore from '@mui/icons-material/Explore';
import Reels from '@mui/icons-material/Slideshow';
import Messages from '@mui/icons-material/Chat';
import Notification from '@mui/icons-material/FavoriteBorder';
import CreatePost from '@mui/icons-material/AddCard';
import Menu from '@mui/icons-material/Menu';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Avatar from '@mui/material/Avatar';
import boy from '../component/assets/Ezz.png';
import "./components.css"



function Leftbar() {

  return (
<div className='leftbar'>
  <img id="insta" src={instalogo} alt="instalogo" width={"100px"} />
  <Link id="but" to="/">
      <ListItemButton>
        <h2><Home fontSize='small'/> Home</h2>
      </ListItemButton>
      </Link>

      <Link  to="/prog">
      <ListItemButton id="but" color='white'>
      <h2><Search fontSize='small'/> Search</h2>
      </ListItemButton>
      </Link>

      <Link  to="/exp">
      <ListItemButton id="but">
        <h2> <Explore fontSize='small'/> Explore</h2>
      </ListItemButton>      </Link>

      <ListItemButton id="but">
        <h2 > <Reels fontSize='small'/> Reels</h2>
      </ListItemButton>

      <ListItemButton id="but">
      <h2><Messages fontSize='small'/> Messages</h2>
      </ListItemButton >

      <ListItemButton id="but">
        <h2> <Notification fontSize='small'/> Notification</h2>
      </ListItemButton>
      <ListItem>
          <ListItemText>
            <Button variant="contained" color="primary">
              Create Post
            </Button>
          </ListItemText>
        </ListItem>

      <Link id="but" to="/prof">
      <ListItemButton id="but">
          <Avatar src={boy}/>
        <ListItemText primary="Ezzkalash" secondary="ezzo" />
        </ListItemButton>
        </Link>

      <ListItemButton >

        <h2 className='menu'> <Menu fontSize='small'/> Menu</h2>
      </ListItemButton>



</div>


  );
}



export default Leftbar;
